INSERT INTO `student_record` VALUES ('2778', 'S200707170', '跟进记录', '跟进方式：上门，跟进日期：2020-07-31。<br>7月底刚复课，暑假前面停了一个月，在上英语课，本次家长会的目的是扩科语文，时间已经安排好并已开课，期末考试成绩是82分，不太理想，五年级开学之后安排了晚辅，后续需要多做服务，跟进孩子的学习', 'yhkn2007', '2020-08-03 14:31:55');
INSERT INTO `student_record` VALUES ('2779', 'S200707099', '跟进记录', '跟进方式：上门，跟进日期：2020-07-29。<br>沟通孩子近期学习情况，化学课程下周结束，孩子课堂状态还是蛮不错的，很认真，对于老师提出的知识点都能回答出来，了解后续课程的安排，前段时间报名6999课程，还未开课，家长打算等九年级开学之后看孩子月考成绩之后再做决定', 'yhkn2007', '2020-08-03 14:40:16');
