INSERT INTO `student_record` VALUES ('2782', 'S200701222', '跟进记录', '跟进方式：上门，跟进日期：2020-07-30。<br>反馈孩子近期的学习情况，给到家长具体的课程记录，以及老师针对孩子做的课堂检测，孩子对于课程吸收的效果并不是很明显，目前数学的上课内容是六年级有理数的加减乘除，对于八年级的内容完全是模糊的，所以需要从最基础的内容开始讲解，课后复习这一点孩子做的也不好，英语单词背的也不是很理想', 'yhkn2007', '2020-08-03 15:00:32');
INSERT INTO `student_record` VALUES ('2783', 'S200707172', '跟进记录', '跟进方式：上门，跟进日期：2020-08-01。<br>反馈孩子近期的学习情况，每周一节课，但是孩子思维特别灵活，对于老师当堂所讲的知识点，掌握情况达到80%以上，孩子理解性较强，老师给孩子做过检测，对于计算方面孩子还是有点粗心的，后续需要强化训练，多做练习', 'yhkn2007', '2020-08-03 15:11:48');
INSERT INTO `student_record` VALUES ('2784', 'S200707085', '跟进记录', '跟进方式：上门，跟进日期：2020-08-02。<br>孩子课时不多，约家长过来沟通下后续课程安排，秋季小班课，报读72课时', 'yhkn2007', '2020-08-03 15:25:21');
