INSERT INTO `student_record` VALUES ('2796', 'S200707142', '跟进记录', '跟进方式：上门，跟进日期：2020-08-05。<br>孩子比较怕爸爸，妈妈很好说话，想考上海音乐学院，目前在练吉他，目标就是考上普通高中，孩子还是比较聪明的，就是比较懒，不愿意背书，后面需要老师盯紧一些孩子', 'wchb2007', '2020-08-05 13:26:52');
INSERT INTO `student_record` VALUES ('2797', 'S200707229', '跟进记录', '跟进方式：上门，跟进日期：2020-08-05。<br>惠小升三中，爸爸初中数学老师，妈妈之前是英语老师，因身体原因 现在教历史，家里对于孩子是很宠爱的，铺垫了秋季定向班的二送一，已经试听了刘文清的数学和魏金东的英语', 'wchb2007', '2020-08-05 14:06:30');
INSERT INTO `student_record` VALUES ('2798', 'S200707236', '跟进记录', '跟进方式：上门，跟进日期：2020-07-29。<br>新生家长会，妈妈过来开的，孩子原本比较排斥英语，在这边跟赵老师相处的很融洽。孩子主要问题是不愿意复习，检查作业，容易粗心。课后作业都有按时完成，妈妈希望老师可以像布置作业一样给孩子布置预习复习的任务，因为老师不跟孩子说会检查作业，孩子会敷衍作业。妈妈说只要孩子愿意在这边还是会继续', 'gxqa2007', '2020-08-05 15:13:02');
INSERT INTO `student_record` VALUES ('2799', 'S200707144', '跟进记录', '跟进方式：上门，跟进日期：2020-07-29。<br>孩子跟家长都有推优自荐的打算，八年级下册期末考试年级第八，之前都在年级第四。数学刚来的时候70多，这学期都保持在90分左右，补课主要听孩子的，家长补课都要问孩子意见，孩子同意才会报名。很喜欢目前的数学老师方梦娜，英语是网课，语文没安排，家长对语文有想法，但具体要看孩子。', 'gxqa2007', '2020-08-05 15:16:41');
INSERT INTO `student_record` VALUES ('2800', 'S200707054', '跟进记录', '跟进方式：上门，跟进日期：2020-07-30。<br>常规铺垫续费家长会。孩子平时算数习惯口算，没有打草稿的习惯，考试经常因为计算问题出错，而且做题速度比较慢。家长反映孩子很喜欢老师，老师也比较细心，对老师这块还是很满意的，表示暑期结束之后会再继续。', 'gxqa2007', '2020-08-05 15:20:48');
INSERT INTO `student_record` VALUES ('2801', 'S200701069', '跟进记录', '跟进方式：上门，跟进日期：2020-07-30。<br>续费家长会。妈妈反映这段时间孩子在家比较放松，课上希望孩子能够安排单独坐。8.9号去南中分班考，续费也要看孩子，妈妈每次报名都会去问孩子意见，孩子不同意不会报名。但学生比较听话，一般熟悉之后很好相处，但是不能在孩子不知情的情况下硬要家长报名或者开家长会的时候跟妈妈说孩子坏话', 'gxqa2007', '2020-08-05 15:25:38');
INSERT INTO `student_record` VALUES ('2802', 'S200707122', '跟进记录', '跟进方式：上门，跟进日期：2020-07-31。<br>续费家长会。之前确定的方案一年，爸爸打算改成一学期，跟家长提前说了价格可能不太一样爸爸有意见。觉得不够信任他。孩子在这边学了一年多，很不自觉，容易分心。爸爸表示希望老师每次反馈如实，不论好的坏的，对孩子要有一定要求跟严厉。', 'gxqa2007', '2020-08-05 15:29:39');
INSERT INTO `student_record` VALUES ('2803', 'S200701009', '跟进记录', '跟进方式：上门，跟进日期：2020-08-05。<br>惠小升三中，孩子独立性比较强，平时孩子都是独立完成作业的，已铺垫秋季定向班，妈妈说是要去孩子自己老师那补，基本上已确定', 'wchb2007', '2020-08-05 15:31:24');
INSERT INTO `student_record` VALUES ('2804', 'S200707205', '跟进记录', '跟进方式：上门，跟进日期：2020-08-05。<br>黄路中学，孩子不爱说话，基础比价差，父母双方都是上海独生子女，老人比较宠孩子，语文68 数学67 英语58，目标：中本贯通，现在学习，不会规划时间，没有背诵的方法', 'wchb2007', '2020-08-05 15:46:20');
INSERT INTO `student_record` VALUES ('2805', 'S200707229', '跟进记录', '跟进方式：上门，跟进日期：2020-08-01。<br>语文方面题材单一，比较大众化，家里给的庇护太多，孩子难了就会放弃，学习劲头不足，目前准备考毛笔8级，每天在家练钢琴，跟钟老师进行阅读打卡', 'wchb2007', '2020-08-05 15:50:19');
INSERT INTO `student_record` VALUES ('2806', 'S200707225', '跟进记录', '跟进方式：上门，跟进日期：2020-08-05。<br>八年级期末考：语文80 数学70 英语90 物理80 历史28，家里还有一个妹妹，家元目前基础不太好，做题的思路不是很清晰，多注意笔记的整理和归纳。在家及时的复习和巩固', 'wchb2007', '2020-08-05 15:57:38');
