INSERT INTO `student_record` VALUES ('2923', 'S200707073', '跟进记录', '跟进方式：上门，跟进日期：2020-08-07。<br>沟通下孩子最近的学习状态，数学课上表现不算太好，偶尔作业忘记带，但是了解清楚之后，说是写完忘带了，打算给孩子数学课转成一对一上课，家长暂时还没有这个打算，等开学之后看孩子月考成绩，如果成绩没有明显进步的话，就考虑转成一对一安排，目前语文课的状态还好，孩子没有大目标，及格就行', 'yhkn2007', '2020-08-10 11:31:10');
INSERT INTO `student_record` VALUES ('2924', 'S200701222', '跟进记录', '跟进方式：上门，跟进日期：2020-08-05。<br>邀约家长会，沟通换数学老师，安排8月份周一至周六每天一节数学课，孩子目前课程进度太慢，课后也需要让老师多布置点基础练习题巩固下', 'yhkn2007', '2020-08-10 11:45:46');
INSERT INTO `student_record` VALUES ('2925', 'S200701224', '跟进记录', '跟进方式：上门，跟进日期：2020-08-15。<br>沟通孩子目前学习情况，英语课前段时间每天一节课，赶现有班课的进度，已经合班，孩子数学基础比较薄弱，原安排的班级也跟不上节奏，目前孩子一个人在上，打算安排加课，后期开学之后合班', 'yhkn2007', '2020-08-10 11:50:02');
INSERT INTO `student_record` VALUES ('2926', 'S200707107', '跟进记录', '跟进方式：上门，跟进日期：2020-08-08。<br>老师反馈下孩子课堂状态，以及给家长沟通下后期的学习计划，课时不够了，提前铺垫下，给到家长相应的课时规划', 'yhkn2007', '2020-08-10 13:44:46');
